    "DISADV_51": {
      "name": "Verstümmelt",
      "source": [
        {
          "id": "US25001",
          "firstPage": 179
        }
      ],
      "options": [
        {
          "id": 1,
          "name": "Einarmig",
          "description": "Einer der beiden Arme des Charakters fehlt mindestens bis zum Ellbogen.\n",
          "src": [
            {
              "id": "US25001",
              "firstPage": 179
            }
          ]
        },
        {
          "id": 2,
          "name": "Einäugig",
          "description": "Eines der beiden Augen des Helden ist blind oder er hat es verloren. Fernkampfangriffe sind dadurch um 4 erschwert.\n",
          "src": [
            {
              "id": "US25001",
              "firstPage": 179
            }
          ]
        },
        {
          "id": 3,
          "name": "Einbeinig",
          "description": "Der Held hat nur ein Bein, bzw. es ist unterhalb des Knies amputiert. Der Geschwindigkeit- Grundwert ist halbiert. Krücken und einfache Prothesen wie ein Holzbein helfen gegen die Verminderung der Geschwindigkeit nicht.\n",
          "src": [
            {
              "id": "US25001",
              "firstPage": 179
            }
          ]
        },
        {
          "id": 4,
          "name": "Einhändig",
          "description": "Dem Abenteurer fehlt eine Hand.\n",
          "src": [
            {
              "id": "US25001",
              "firstPage": 179
            }
          ]
        },
        {
          "id": 5,
          "name": "Einohrig",
          "description": "Eines der Ohren ist abgeschnitten oder verkrüppelt. Proben auf *Sinnesschärfe* auf Hören sind für den Helden grundsätzlich um 1 erschwert.\n",
          "src": [
            {
              "id": "US25001",
              "firstPage": 179
            }
          ]
        },
        {
          "id": 6,
          "name": "Eunuch I",
          "description": "Die Hoden des Helden wurden entfernt. Er hat automatisch den Nachteil *Unfruchtbar* (siehe **Wege der Vereinigung** Seite **154**).<br>\nProben auf *Betören (Liebeskünste)* sind um 1 erschwert.<br>\nProben auf *Willenskraft (Betören widerstehen)* sind für ihn um 1 erleichtert.<br>\nMit diesem Nachteil kann man aber noch eine Erektion bekommen.\n",
          "src": [
            {
              "id": "US25213",
              "firstPage": 154
            }
          ]
        },
        {
          "id": 7,
          "name": "Eunuch II",
          "description": "Das ganze Geschlechtsteil des Helden wurde entfernt. Er hat automatisch den Nachteil *Impotent* und *Unfruchtbar* (siehe **Wege der Vereinigung** Seite **152/154**).<br>\nProben auf *Betören (Liebeskünste)* sind um 2 erschwert.<br>\nBei einigen Sexpraktiken kann die Erschwernis höher ausfallen oder ganz unmöglich sein.<br>\nProben auf *Willenskraft (Betören widerstehen)* sind für ihn um 2 erleichtert.\n",
          "src": [
            {
              "id": "US25213",
              "firstPage": 154
            }
          ]
        }
      ]
    },
